import { useEffect, useState } from "react";



function Ecdata() {

    const [data, setData] = useState([])

    useEffect(() => {

        fetch("http://localhost:3005/E-commerce")
            .then((res) => {
                return res.json()
            })
            .then((resp) => {
                console.log(resp)

                setData(resp)
            })
    }, [])

    return (

        <div className="container-fluid">




            {/* {data.map((item)=>(
              <div>
