                padding: "10px", marginBottom: "15px"
            }}>

                <div className="col text-warning">
                    HTML
                </div>
                <div className="col">
                    CSS
                </div>
                <div className="col">
                    JAVSCRIPT
                </div>
            </div> */}


            <div className="row">
                <div className="col">
                    <div class="card" style={{ width: "18rem" }}>
                    {data.map((item)=>(
              <div>
              <p><img src={item.image} style={{width:"200px",height:"200px"}}/> </p>
              <h3>{item.brand}</h3>
              <p>{item.name}</p>
              <p>{item.price}</p>
              </div>
  
            ))}  

                    </div>
                </div>

            </div>
        </div>




    )

}
export default Ecdata;
